import { Link } from "react-router-dom";

function NavBar(){
    return(
            <div id = "links">
            <ul class = "nav">
                <li><Link to="/">Home</Link></li>
                <li><Link to="/players">Home</Link></li>
                <li><Link to="/reduxEx">Redux Example</Link></li>
                <li>My Team</li>
                <li>Log in/ Log out</li>
                <li>Standings</li>
            </ul>
        </div>
    )
}

export default NavBar
